<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <script src="https://cdn.tailwindcss.com"></script>
  <style type="text/tailwindcss">
    @layer utilities {
          .content-auto {
            content-visibility: auto;
          }
        }
    </style>
    <link rel="stylesheet" href="./searchStyle.css">
    <title>search results</title>
</head>
<body>
    <nav
      class="relative flex w-full items-center justify-between bg-[#222d3f] py-2 shadow-sm shadow-neutral-700/10  lg:flex-wrap lg:justify-start"
      data-te-navbar-ref>
      <!-- Container wrapper -->
      <div 
        class="flex w-full flex-wrap items-center justify-between px-6">
        <div 
          class="flex items-center">
          <!-- Toggle button -->
          <button
            class="block border-0 bg-transparent py-2 pr-2.5 text-neutral-500 hover:no-underline hover:shadow-none focus:no-underline focus:shadow-none focus:outline-none focus:ring-0 lg:hidden"
            type="button" data-te-collapse-init data-te-target="#navbarSupportedContentY"
            aria-controls="navbarSupportedContentY" aria-expanded="false" aria-label="Toggle navigation">
            <span 
              class="[&>svg]:w-7">
              <svg 
                xmlns="http://www.w3.org/2000/svg" 
                viewBox="0 0 24 24" 
                fill="currentColor" 
                class="h-7 w-7">
                <path 
                  fill-rule="evenodd"
                  d="M3 6.75A.75.75 0 013.75 6h16.5a.75.75 0 010 1.5H3.75A.75.75 0 013 6.75zM3 12a.75.75 0 01.75-.75h16.5a.75.75 0 010 1.5H3.75A.75.75 0 013 12zm0 5.25a.75.75 0 01.75-.75h16.5a.75.75 0 010 1.5H3.75a.75.75 0 01-.75-.75z"
                  clip-rule="evenodd" />
              </svg>
            </span>
          </button>
        </div>

        <!-- Collapsible wrapper -->
        <div 
          class="!visible hidden flex-grow basis-[100%] items-center lg:!flex lg:basis-auto"
          id="navbarSupportedContentY" 
          data-te-collapse-item>
          <!-- Left links -->
          <ul 
            class="mr-auto lg:flex lg:flex-row" 
            data-te-navbar-nav-ref>
            <li 
              data-te-nav-item-ref>
              <a 
                class="block py-2 pr-2 text-neutral-500 transition duration-150 ease-in-out hover:text-neutral-600 focus:text-neutral-600"
                href="./index.html" 
                data-te-nav-link-ref 
                data-te-ripple-init 
                data-te-ripple-color="light" 
                disabled>Dashboard</a>
            </li>
            <li 
              data-te-nav-item-ref>
              <a 
               class="block py-2 pr-2 text-neutral-500 transition duration-150 ease-in-out hover:text-neutral-600 focus:text-neutral-600"
                href="#!" data-te-nav-link-ref data-te-ripple-init data-te-ripple-color="light">Team</a>
            </li>
            <li  
             class="mb-2 lg:mb-0" data-te-nav-item-ref>
              <a 
                class="block py-2 pr-2 text-neutral-500 transition duration-150 ease-in-out hover:text-neutral-600 focus:text-neutral-600"
                href="#!" 
                data-te-nav-link-ref 
                data-te-ripple-init 
                data-te-ripple-color="light">
                  
              </a>
            </li>
          </ul>
          <!-- Left links -->
        </div>
        <!-- Collapsible wrapper -->
      </div>
      <!-- Container wrapper -->
    </nav>


</body>
</html>
